type List struct {
	Int int
	Next *List
}

func NewList(numbers ...int) *List {
	var root, prev, now *List
	root = &List{numbers[0], nil}
	for i:=0; i<len(numbers); i++ {
		if i == 0 {
			now = root
		} else {
			now = &List{numbers[i], nil}
			prev.Next = now
		}
		prev = now
	}

	return root
}